import { BrowserRouter, Route} from 'react-router-dom';
import React, {useState, useEffect} from 'react';
import { 
    Login,
    Registration,
    Confirmation
 } from '../pages';
function App() {


  return(
    <>
      <BrowserRouter>
      <div>
        <Route exact path='/' element = {<Login />}/>
        <Route  path='/signup' element = {<Registration />}/>
        <Route  path='/confirm' element = {<Confirmation />}/>



      </div>
      </BrowserRouter>

    </>
  )
}

export default App;
